/*
	This script is not used for Production. It is used to set up DEV (or local)
	by using both the VSR and non-VSR table and the import stored procedure.
*/

IF OBJECT_ID('tempdb..[#stgTradeVendorsNoVSR]') IS NOT NULL DROP TABLE [#stgTradeVendorsNoVSR];

CREATE TABLE [#stgTradeVendorsNoVSR]
(
	[LegacyId] varchar(12) NULL
,	[SAPVendorId] varchar(12) NOT NULL
,	[SAPVendorName] varchar(158) NOT NULL
,	[VendorName] varchar(100) NOT NULL
,	[BlockIndicator] char NULL
,	[CurrencyTypeId] varchar(50) NULL
);


DELETE	dst
FROM	[dbo].[stgTradeVendorsNoVSR] dst
	LEFT JOIN [#stgTradeVendorsNoVSR] src ON dst.[SAPVendorId] = src.[SAPVendorId]
WHERE	src.[SAPVendorId] IS NULL;

UPDATE	dst
SET	[LegacyId] = src.[LegacyId]
,	[SAPVendorName] = src.[SAPVendorName]
,	[VendorName] = src.[VendorName]
,	[BlockIndicator] = src.[BlockIndicator]
,	[CurrencyTypeId] = src.[CurrencyTypeId]
FROM	[dbo].[stgTradeVendorsNoVSR] dst
JOIN	[#stgTradeVendorsNoVSR] src ON dst.[SAPVendorId] = src.[SAPVendorId]
WHERE	(src.[LegacyId] IS NULL AND dst.[LegacyId] IS NOT NULL) OR (src.[LegacyId] IS NOT NULL AND dst.[LegacyId] IS NULL) OR src.[LegacyId] <> dst.[LegacyId]
OR	src.[SAPVendorName] <> dst.[SAPVendorName]
OR	src.[VendorName] <> dst.[VendorName]
OR	(src.[BlockIndicator] IS NULL AND dst.[BlockIndicator] IS NOT NULL) OR (src.[BlockIndicator] IS NOT NULL AND dst.[BlockIndicator] IS NULL) OR src.[BlockIndicator] <> dst.[BlockIndicator]
OR	(src.[CurrencyTypeId] IS NULL AND dst.[CurrencyTypeId] IS NOT NULL) OR (src.[CurrencyTypeId] IS NOT NULL AND dst.[CurrencyTypeId] IS NULL) OR src.[CurrencyTypeId] <> dst.[CurrencyTypeId];

INSERT	[dbo].[stgTradeVendorsNoVSR] (
	[LegacyId], [SAPVendorId], [SAPVendorName], [VendorName]
,	[BlockIndicator], [CurrencyTypeId]
)
SELECT	src.[LegacyId], src.[SAPVendorId], src.[SAPVendorName], src.[VendorName]
,	src.[BlockIndicator], src.[CurrencyTypeId]
FROM	[#stgTradeVendorsNoVSR] src
	LEFT JOIN [dbo].[stgTradeVendorsNoVSR] dst ON dst.[SAPVendorId] = src.[SAPVendorId]
WHERE	dst.[SAPVendorId] IS NULL;

